textOriginal:
Coisas que eu gostei dessa eleição:
1) Sérgio Moro eleito senador (chupa essa manga, Lula!) 🙂;
2) Deltan Dallagnol eleito deputado federal, com mais votos do que a Gleise Hoffman;
3) Márcio França não levou o senado por São Paulo (João Dória manda lembranças, seu vacilão);
4) Kim Kataguiri, odiado pelos bolsonaristas, pelos petistas, pela Globo, conseguiu se reeleger;
5) Gostei que a diferença de votos entre 6 (Lula) e Meia-dúzia (Bolsonaro) não foi tão grande, com isso tirando AINDA mais a credibilidade desses instituto de pesquisa que eleição após eleição, continuam errado feio o resultado;
6) Gostei de ver que os artistas da Bollywood brasileira não tem a menor influência nos eleitores brasileiros, embora se achem super influentes.

P.S. Parabéns ao Paraná por elegerem Sérgio Moro, Dallagnol e não elegerem Requião.
